import React, { useEffect } from "react";
import classes from "./CovidMap.module.css";
const CovidMap = () => {
  useEffect(() => {
    var container = document.getElementById("map");
    var options = {
      center: new window.kakao.maps.LatLng(36.450701, 127.870667),
      level: 13,
    };

    var map = new window.kakao.maps.Map(container, options);

    map.setMaxLevel(13);
    map.setMinLevel(12);
    map.setDraggable(false);
    map.setZoomable(false);
    var places = new window.kakao.map.services.Places();

    var callback = function (result, status) {
      if (status === window.kakao.maps.services.Status.OK()) {
        console.log(result);
      }
    };

    places.keywordSearch("판교 치킨", callback);

    console.log("loading kakamap");
  }, []);

  return (
    <>
      <div className={classes.container}>
        <div id="map" style={{ width: "80%", height: "30rem" }}></div>
      </div>
      <script
        type="text/javascript"
        src="//dapi.kakao.com/v2/maps/sdk.js?appkey=44adb99a6b252fb06af1b88a272b62fd&libraries=services"
      ></script>
    </>
  );
};

export default CovidMap;
